['#include<stdio.h>

int cmpfunc(const void * s, const void * r)
{
    return ( *(int*)s - *(int*)r);
}

int main()
{
    int n, m, i, j, count=0;
    scanf("%d", &n);
    int a[n];
    for(i=0;i<n;i++)
    {
        scanf("%d", &a[i]);
    }
    qsort(a,n,sizeof(int),cmpfunc);
    scanf("%d", &m);
    int b[m];
    for(j=0;j<m;j++)
    {
        scanf("%d", &b[j]);
    }
    j=0;
    while(j<m)
    {
        i=0;
        while(a[i]<=b[j])
        {
            count++;
            i++;
        }
        printf("%d\n", count);
        count=0;
        j++;
    }

    return 0;
}
