['#include<stdio.h>
#include<stdlib.h>
long long sort(const void*x,const void*y)
{
    return ( *(long long*)x - *(long long*)y );
}
int main()
{
    long long n,i,a[200000],q,j,x,start,end,mid;
    scanf("%lld",&n);
    for(i=0;i<n;i++)
    {
        scanf("%lld",&a[i]);
    }
    qsort(a,n,sizeof(long long),sort);
    scanf("%lld",&q);
    for(j=1;j<=q;j++)
    {
        scanf("%lld",&x);
        if(x<a[0])
        {
            printf("0\n");
        }
        else if(x==a[0])
        {
            printf("1\n");
        }
        else if(x>=a[n-1])
        {
            printf("%lld\n",n);
        }
        else
        {
            start=0;
            end=n-1;
            while(start<=end)
            {
                mid=(start+end)/2;
                if(a[mid]>=x&&a[mid-1]<x)
                {
                    if(a[mid]>x)
                    {
                    printf("%lld\n",mid);
                    break;
                    }
                    else if(a[mid]==x)
                    {
                        printf("%lld\n",mid+1);
                        break;
                    }
                }
                else if(a[mid]<x)
                {
                    start=mid+1;
                }
                else if(a[mid]>=x&&a[mid-1]>=x)
                {
                    end=mid-1;
                }
            }

        }
    }
    return 0;
}']

