    scanf("%d", &n);
    for(i = 0; i < n; i++)
    {
        scanf("%d", &q);
        count[q]++;
    }
    for(i = 1; i < 100001; i ++)
    {
        count[i] += count[i - 1];
    }
    scanf("%d", &n);
    while(n--)
    {
        scanf("%d", &q);
        printf("%d\n", count[q <= 100000 ? q : 100000]);
    }
    return 0;
}']

