}']

['#include<stdio.h>

int partion(long long int a[100000], int start, int end)
{
    int pindex=start,pivot=a[end],temp,i;
    for(i=start;i<end;i++)
    {
        if(a[i]<=pivot)
        {
            temp=a[pindex];
            a[pindex]=a[i];
            a[i]=temp;
            pindex++;
        }
    }
    temp=a[pindex];
    a[pindex]=a[end];
    a[end]=temp;
    return pindex;
}

void quick_sort(long long int a[100000],int start,int end)
{
    int pindex;
    if(end>start)
    {
        pindex=partion(a,start,end);
        quick_sort(a,start,pindex-1);
        quick_sort(a,pindex+1,end);
    }
}

int binary_search(long long int a[],int x,int high,int low)
{
    int mid=low+(high-low)/2;
    if(high<low)
        return high;
    if(x==a[mid])
        return mid;
    else if(x<a[mid])
        binary_search(a,x,mid-1,low);
    else if(x>a[mid])
        binary_search(a,x,high,mid+1);
}

int main()
{
    long long int price[100000], m;
    int n, q, i, j;
    scanf("%d", &n);

    for(i = 0; i < n; i++)
    {
        scanf("%lld", &price[i]);
    }
    quick_sort(price, 0, n - 1);
    scanf("%d", &q);

    for(i = 0; i < q; i++)
    {
        scanf("%lld", &m);
        if(m < price[0])
            printf("0\n");
        else if(m >= price[n - 1])
            printf("%d\n", n);
        else
            printf("%d\n", binary_search(price, m, n, 0) + 1);
    }
    return 0;
}']

