['#include<stdio.h>
#include<stdlib.h>
void get(int *p,int n)
{
    int i;
      for ( i = 0;i<n; i++)
    {
         scanf("%d",&p[i]);

    }
}
int binary(int *p,int n,int x)
{
    int left,right,mid,i,c=0;
    left=0;
    right=n-1;
    for ( i = 0;left<=right; i++)
    {
        mid=(left+right)/2;
       if(x>=p[mid])
       {
           c=c+abs(((mid-left)+1));
           left=mid+1;
       }
       else
       {
           right=mid-1;
       }
       
    }
    return c;
    
  
}

int cmpfunc (const void * a, const void * b) {
   return ( *(int*)a - *(int*)b );
}
int main()
{
    int n,i,q,c=0;
    scanf("%d",&n);
    int x[n];
    get(x,n);
    qsort(x,n,sizeof(int),cmpfunc);
    scanf("%d",&q);
    int m[q];
  for (i= 0;i<q; i++)
    {  
       scanf("%d",&m[i]);
       c=binary(x,n,m[i]);
       printf("%d\n",c);
    }
     
}



